webpackJsonp([0x808052e21e92],{4172:function(t,a){t.exports={data:{markdownRemark:{html:'<p>あんまりに XML スタイルシートがｇｄｇｄになっていたので、作り直すついでに大変なリニューアルをしていきました。やっぱXMLで組むとリニューアルするときに各ファイルを書き換える量がHTMLよりも少なくて楽だのぅ。(その代わり、Googleに変な引っ掛かり方するようになるデメリットもあるが)</p>\n<h2>とってもどうでもいい技術的な話</h2>\n<ul>\n<li>prototype.js のクエリ分解は“&#x26;”のみで“;”はダメっぽいのね。</li>\n<li>画像やiframeを遅延ロードさせるためにHTML規格外の独自タグ吐かせて、それをjavascript側でimgなどに置き換えると言う<em>外道極まりない</em>ことをやってたりします。もっとスマートな方法あったら教えて。</li>\n</ul>\n<p><strong>転勤決まった</strong> </p>\n<p>来週から5月末頃まで、宇都宮に飛びます。その間も<a href="http://e.danmaq.com/">個人通販</a>など一部活動は継続しますが、ゲーム制作や発送処理など、やや遅れることがありますので予めご了承ください。</p>',frontmatter:{cover:null,date:"2008-04-11T22:49:00+09:00",strDate:"2008/4/11",title:"新装開店"}}},pathContext:{path:"/ja/blog/2008/04/11-新装開店/",langKey:"ja"}}}});
